        uint256 tAmount,
        bool isSell
    ) private {
        (
            uint256 rAmount,
            uint256 rTransferAmount,
            uint256 rFee,
            uint256 tTransferAmount,
            uint256 tFee,
            uint256 tLiquidity
        ) = _getValues(tAmount);
        _rOwned[sender] = _rOwned[sender].sub(rAmount);
        _rOwned[recipient] = _rOwned[recipient].add(rTransferAmount);
        _takeLiquidity(tLiquidity, isSell);
        _reflectFee(rFee, tFee);
        emit Transfer(sender, recipient, tTransferAmount);
    }

    function _transferToExcluded(
        address sender,
        address recipient,
        uint256 tAmount,
        bool isSell
    ) private {
        (
            uint256 rAmount,
            uint256 rTransferAmount,
            uint256 rFee,
            uint256 tTransferAmount,
            uint256 tFee,
            uint256 tLiquidity
        ) = _getValues(tAmount);
        _rOwned[sender] = _rOwned[sender].sub(rAmount);
        _tOwned[recipient] = _tOwned[recipient].add(tTransferAmount);
        _rOwned[recipient] = _rOwned[recipient].add(rTransferAmount);
        _takeLiquidity(tLiquidity, isSell);
        _reflectFee(rFee, tFee);
        emit Transfer(sender, recipient, tTransferAmount);
    }

    function _transferFromExcluded(
        address sender,
        address recipient,
        uint256 tAmount,
        bool isSell
    ) private {
        (
            uint256 rAmount,
            uint256 rTransferAmount,
            uint256 rFee,
            uint256 tTransferAmount,
            uint256 tFee,
            uint256 tLiquidity
        ) = _getValues(tAmount);
        _tOwned[sender] = _tOwned[sender].sub(tAmount);
        _rOwned[sender] = _rOwned[sender].sub(rAmount);
        _rOwned[recipient] = _rOwned[recipient].add(rTransferAmount);
        _takeLiquidity(tLiquidity, isSell);
        _reflectFee(rFee, tFee);
        emit Transfer(sender, recipient, tTransferAmount);
    }

    function calculateBNBReward(address ofAddress)
        public
        view
        returns (uint256)
    {
        uint256 tSupply = uint256(_tTotal)
        .sub(balanceOf(address(0)))
        .sub(balanceOf(0x000000000000000000000000000000000000dEaD)) // exclude burned wallet
        .sub(balanceOf(address(pancakePair)));
        // exclude liquidity wallet

        return
            getBNBReward(
                balanceOf(address(ofAddress)),
                address(this).balance,
                tSupply
            );
    }

    function getBNBReward(
        uint256 currentBalance,
        uint256 currentBNBPool,
        uint256 tSupply
    ) private pure returns (uint256) {
        uint256 bnbPool = currentBNBPool;

        // calculate reward to send

        uint256 multiplier = 100;

        // now calculate reward
        uint256 reward = bnbPool
        .mul(multiplier)
        .mul(currentBalance)
        .div(100)
        .div(tSupply);

        return reward;
    }

    function getRewardCycleBlock() public view returns (uint256) {
        return rewardCycleBlock;
    }

    function claimBNBReward() public isHuman nonReentrant {
        require(
            nextAvailableClaimDate[msg.sender] <= block.timestamp,
            "Error: next available not reached"
        );
        require(
            balanceOf(msg.sender) >= 0,
            "Error: must own GDOGE to claim reward"
        );

        uint256 reward = calculateBNBReward(msg.sender);

        // reward threshold
        if (reward >= rewardThreshold && _takeCharityFee) {
            uint256 charityamount = reward.div(_charityFeePercent);
            (bool success, ) = address(_charityAddress).call{
                value: charityamount
            }("");
            require(
                success,
                "Address: unable to send value, charity may have reverted"
            );

            reward = reward.sub(reward.div(_charityFeePercent));
        }

        // update rewardCycleBlock
        nextAvailableClaimDate[msg.sender] =
            block.timestamp +
            getRewardCycleBlock();

        emit ClaimBNBSuccessfully(
            msg.sender,
            reward,
            nextAvailableClaimDate[msg.sender]
        );

        (bool sent, ) = address(msg.sender).call{value: reward}("");
        require(sent, "Error: Cannot withdraw reward");
    }

    function topUpClaimCycleAfterTransfer(
        address sender,
        address recipient,
        uint256 amount,
        bool isSell
    ) private {
        uint256 currentSenderBalance = balanceOf(sender);
        uint256 currentRecipientBalance = balanceOf(recipient);
        uint256 basedRewardCycleBlock = getRewardCycleBlock();

        if (isSell && currentSenderBalance == amount) {
            // initate claim date when sell entire token
            nextAvailableClaimDate[sender] = 0;
        } else {
            nextAvailableClaimDate[recipient] =
                nextAvailableClaimDate[recipient] +
                calculateTopUpClaim(
                    currentRecipientBalance,
                    basedRewardCycleBlock,
                    threshHoldTopUpRate,
                    amount
                );
        }
    }

    function calculateTopUpClaim(
        uint256 currentRecipientBalance,
        uint256 basedRewardCycleBlock,
        uint256 tHoldTopUpRate,
        uint256 amount
    ) private view returns (uint256) {
        if (currentRecipientBalance == 0) {
            return block.timestamp + basedRewardCycleBlock;
        } else {
            uint256 rate = amount.mul(100).div(currentRecipientBalance);

            if (uint256(rate) >= tHoldTopUpRate) {
                uint256 incurCycleBlock = basedRewardCycleBlock
                .mul(uint256(rate))
                .div(100);

                if (incurCycleBlock >= basedRewardCycleBlock) {
                    incurCycleBlock = basedRewardCycleBlock;
                }

                return incurCycleBlock;
            }

            return 0;
        }
    }

